import { Component, Prop, Vue } from 'vue-property-decorator';

@Component
export default class Toggle extends Vue {
  @Prop() name: string;
  @Prop({default: false}) value: boolean;

  onChange(evt: any) {
    this.$emit('input', evt.target.checked);
  }
}
